import React from 'react';
import './home.css';
import { Link, Route,Routes } from 'react-router-dom';
import About from '../about/about';


export const Login = () => {
  return (
    <div>
        <div className='Loginpage'>
        <nav>
  <ul><Link to="/about">Login</Link></ul>
  <ul>About</ul>
    </nav>

<Routes>

    <Route path="/" element={<About />} />
</Routes>
        </div>

    </div>
  )
}
export default Login;
